const { v4: uuidv4 } = require("uuid"); // For generating unique tokens

const get_Token_generate = async function (req, res) {
  const { apiKey } = req.body; // Assuming apiKey is sent in the request body

  if (!apiKey) {
    return ReE(res, { message: "apiKey is required" }, 400);
  }

  let err, apiUser;
  [err, apiUser] = await to(ApiUser.findOne({ where: { apiKey: apiKey } }));
  if (err) return ReE(res, err, 500);

  if (!apiUser) {
    return ReE(res, { message: "Invalid apiKey" }, 401);
  }

  // Generate a unique token (using uuid)
  const apiToken = uuidv4();

  // Update the user's apiToken in the database
  apiUser.apiToken = apiToken;
  [err, apiUser] = await to(apiUser.save());
  if (err) return ReE(res, err, 500);

  return ReS(res, { token: apiToken });
};

