const generateApiKey = async function (req, res) {
  const { username } = req.body;

  if (!username) {
    return ReE(res, { message: "Username is required" }, 400);
  }

  // Check if username already exists
  let err, existingUser;
  [err, existingUser] = await to(
    ApiUser.findOne({ where: { username: username } })
  );
  if (err) return ReE(res, err, 500);

  if (existingUser) {
    return ReE(res, { message: "Username already exists" }, 400);
  }

  // Generate a unique API key (using uuid)
  const apiKey = uuidv4();

  // Create a new ApiUser record
  let newUser;
  [err, newUser] = await to(
    ApiUser.create({
      username: username,
      apiKey: apiKey,
    })
  );
  if (err) return ReE(res, err, 500);

  return ReS(
    res,
    { apiKey: apiKey, message: "API Key generated successfully" },
    201
  );
};

